import React from 'react';
import { Link } from "react-router-dom";
import Button from 'react-bootstrap/Button';

function UserdetailsTable({ userName, email, userId }) {
    return (
        <div>
            <table className='users-table'>
                <thead>
                    <tr>
                        <th>User Name</th>
                        <th>Email</th>
                        <th colSpan={2}>Status</th>
                        <th>Remove</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{userName}</td>
                        <td>{email}</td>
                        <td><Button variant="success" as={Link}>Active</Button></td>
                        <td><Button variant="dark" as={Link}>Inactive</Button></td>
                        <td><Button variant="danger" as={Link}>Remove</Button>{' '}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default UserdetailsTable;
